import vue from 'vue';
import App from './App.vue'

import clevertap from 'clevertap-web-sdk'
clevertap.privacy.push({optOut: false}) // Set the flag to true, if the user of the device opts out of sharing their data
clevertap.privacy.push({useIP: false})  // Set the flag to true, if the user agrees to share their IP data
clevertap.init('TEST-654-Z9R-646Z', 'eu1') // Replace with values applicable to you. Refer below


if (vue) {
    Vue.prototype.$clevertap = clevertap; // Make CleverTap available in Vue components

    new Vue({
      render: (h) => h(App),
    }).$mount('#app');
  } else {
    console.error('Vue is not defined. Make sure Vue is properly installed.')
  }
